func (cos *CattleOutSelect) sqlScan(ctx context.Context, v interface{}) error {
	for _, f := range cos.fields {
		if !cattleout.ValidColumn(f) {
			return &ValidationError{Name: f, err: fmt.Errorf("invalid field %q for selection", f)}
		}
	}
	rows := &sql.Rows{}
	query, args := cos.sqlQuery().Query()
	if err := cos.driver.Query(ctx, query, args, rows); err != nil {
		return err
	}
	defer rows.Close()
	return sql.ScanSlice(rows, v)
}

